static HMODULE _h_openblas = NULL;
void* rindow_load_openblas_func(char *funcname)
{
    if(_h_openblas==NULL) {
        _h_openblas = LoadLibraryA( "libopenblas.dll" );
        if(_h_openblas==NULL) {
            printf("load error: libopenblas\n");
            return NULL;
        }
    }
    return GetProcAddress( _h_openblas, funcname );
}
